-- ----------------------------
-- Table structure for sys_chain
-- ----------------------------
DROP TABLE IF EXISTS `sys_chain`;
CREATE TABLE `sys_chain` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT '区块链id',
  `parent_id` int NOT NULL DEFAULT '0' COMMENT '所属链ID如果没有则为0',
  `code` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '区块链代号 例:BTC LTC',
  `name` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '区块链名称',
  `type` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT 'chain' COMMENT '类型,chain表示链;standard表示协议,默认为chain',
  `intervals` int NOT NULL COMMENT '出块时间(秒)',
  `status` int NOT NULL DEFAULT '1' COMMENT '状态:,0:禁用;1:启用;其他保留，默认为1',
  `confirmations` int NOT NULL COMMENT '网络确认数',
  `enable_track_fee` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否需要定时获取网络交易费(如eth gas fee等),0:不需要;1:需要;默认为1',
  `specification` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '充值/提现/分层钱包共用规范,默认为空表示使用链code对应的工作器',
  `block_url` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '区块记录查询URL',
  `tx_url` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '交易记录查询URL',
  `tx_fee_url` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '交易费抓取网站URL',
  `properties` varchar(500) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '区块链扩展属性(JSON格式)',
  `memo` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注说明',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `uk_code` (`code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1148 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='区块链网络表';

-- ----------------------------
-- Records of sys_chain
-- ----------------------------
BEGIN;
COMMIT;

