  `server_node_id` int NOT NULL COMMENT '钱包服务节点Id,对应sys_server_node的id字段',
  `chain_id` int unsigned NOT NULL COMMENT '区块链id对应sys_chain表的id',
  `height` bigint unsigned NOT NULL COMMENT '当前钱包扫描区块高度',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `uk_chain_node` (`chain_id`,`server_node_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='链当前扫描的最新区块高度记录表';

