  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '币种rpc配置创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '币种rpc配置更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_chain_host` (`host`,`chain_id`) USING BTREE
