-- ----------------------------
-- Table structure for sys_currency
-- ----------------------------
DROP TABLE IF EXISTS `sys_currency`;
CREATE TABLE `sys_currency` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT '币种唯一id',
  `code` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '币种代号 例:BTC LTC',
  `symbol` varchar(4) NOT NULL DEFAULT '' COMMENT '币种符号',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '币种名称',
  `status` int NOT NULL DEFAULT '1' COMMENT '状态:,0:禁用;1:启用;其他保留，默认为1',
  `type` int NOT NULL DEFAULT '0' COMMENT '类型0表示链上币种;1表示非链上币种;默认为0',
  `logo_url` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '币种LOGO图地址',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `uk_code` (`code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=30572 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='币种表';

-- ----------------------------
-- Records of sys_currency
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for sys_server_node
-- ----------------------------
DROP TABLE IF EXISTS `sys_server_node`;
CREATE TABLE `sys_server_node` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT '钱包服务节点ID',
  `code` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '钱包服务节点代号',
  `name` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '钱包服务节点名称',
  `host` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '钱包服务节点主机ip或名称',
  `enable_deposit` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否开启充值任务,0:禁用;1:启用;其他保留，默认为1',
  `enable_aggregate` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否开启归集任务,0:禁用;1:启用;其他保留，默认为1',
  `enable_withdraw` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否开启提现任务,0:禁用;1:启用;其他保留，默认为1',
  `enable_sign` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否开启交易签名任务,0:禁用;1:启用;其他保留，默认为1',
  `enable_stat` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否开启统计任务,0:禁用;1:启用;其他保留，默认为1',
  `enable_crawler` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否开启数据抓取任务(如链上交易费eth gas等)0:禁用;1:启用;其他保留，默认为1',
  `enable_reload_cache` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否需要更新节点缓存,0:禁用;1:启用;其他保留，默认为0',
  `status` int NOT NULL DEFAULT '1' COMMENT '节点状态0为禁用;1:启用;其他保留',
  `memo` varchar(50) NOT NULL DEFAULT '' COMMENT '节点备注说明',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `uk_code` (`code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='钱包部署服务节点表';

-- ----------------------------
-- Records of sys_server_node
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for sys_token
-- ----------------------------
DROP TABLE IF EXISTS `sys_token`;
CREATE TABLE `sys_token` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT '区块链代币ID',
  `currency_id` int NOT NULL COMMENT '所属币种,sys_currency的id字段',
  `chain_id` int NOT NULL COMMENT '所属区块链,对应sys_chain的id字段',
  `standard_id` int NOT NULL DEFAULT '0' COMMENT '所属代币协议(如:ERC20等),对应sys_chain_standard的id字段',
  `server_node_id` int NOT NULL COMMENT '所属钱包服务节点,对应sys_server_node的id字段',
  `code` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '链上代币代号(唯一) 例:BTC/BTC_ERC20/ LTC/USDT_TRC20等',
  `name` varchar(50) NOT NULL COMMENT '代号名称(唯一)',
  `type` int NOT NULL COMMENT '链上币种类型:1:主币;2:代币；其他保留',
  `decimals` int NOT NULL COMMENT '币种精度',
  `address_regex` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '代币地址正则表达式',
  `address_token_code` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '共用地址代币代号(对应当前表的code字段)表示此币与它共用同一个充值地址，不单独创建新地址(如erc20的币种都共用eth币的地址)',
  `main_token_code` varchar(50) NOT NULL DEFAULT '0' COMMENT '链的主代币(如ETH/BNB/MATIC等）',
  `specification` varchar(50) NOT NULL DEFAULT '' COMMENT '代币充值/提现/分层钱包共用规范,默认为空表示使用token.code对应的工作器',
  `min_deposit_amount` decimal(32,16) NOT NULL DEFAULT '0.0000000000000000' COMMENT '最小充值金额',
  `min_withdraw_amount` decimal(32,16) NOT NULL DEFAULT '0.0000000000000000' COMMENT '最小提现金额',
  `max_withdraw_amount` decimal(32,16) NOT NULL COMMENT '最大提现金额',
  `min_reserved_amount` decimal(32,16) NOT NULL COMMENT '最小保留金额,防止Account交易模型(eth/bnb等)的币提现手续费不够',
  `withdraw_fees` decimal(16,8) NOT NULL DEFAULT '0.00000000' COMMENT '提现手续费',
  `contract_address` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '代币智能合约地址',
  `enable_default` tinyint(1) NOT NULL COMMENT '是否当前币种的默认代币1表示是true;0表示否false)默认为0',
  `enable_aggregate` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否需要归集(1表示是true;0表示否false)默认为1',
  `sign_type` tinyint NOT NULL DEFAULT '1' COMMENT '交易签名类型1:单签;2:多签(2-3);其他保留.默认为单签',
  `status` int NOT NULL DEFAULT '1' COMMENT '状态:0:禁用;1:启用;其他保留，默认为1',
  `table_specs` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '对应的表结构规范(account/utxo/omni等)',
  `properties` varchar(500) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '扩展属性(JSON格式)',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `uk_code` (`code`) USING BTREE,
  UNIQUE KEY `uk_chain_currency` (`currency_id`,`chain_id`),
  UNIQUE KEY `uk_name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=20029 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='链上代币表';

-- ----------------------------
-- Records of sys_token
-- ----------------------------
BEGIN;
COMMIT;

